DROP DATABASE ELECTIVE;
CREATE DATABASE ELECTIVE;

USE ELECTIVE;

-- DROP TABLE STUDENT CASCADE;
-- DROP TABLE FACULTY CASCADE;
-- DROP TABLE LOGIN CASCADE;
-- DROP TABLE DEPARTMENT CASCADE;
-- DROP TABLE ELECTIVE CASCADE;

CREATE TABLE DEPARTMENT (
	DEPARTMENT_ID VARCHAR(100) NOT NULL,
	DEPARTMENT_NAME VARCHAR(30) NOT NULL,
	FACULTY_ID_MANAGE VARCHAR(100),
	PRIMARY KEY(DEPARTMENT_ID)
);

CREATE TABLE FACULTY (
	
	FACULTY_ID VARCHAR(100) NOT NULL,
	FACULTY_NAME VARCHAR(30) NOT NULL,
    FACULTY_EMAIL VARCHAR(320) NOT NULL,
	DEPARTMENT_ID VARCHAR(100) NOT NULL,
	PRIMARY KEY(FACULTY_ID),
	FOREIGN KEY(DEPARTMENT_ID) REFERENCES DEPARTMENT(DEPARTMENT_ID),
    UNIQUE(FACULTY_EMAIL)
);

CREATE TABLE ELECTIVE (
	ELECTIVE_NAME VARCHAR(30) NOT NULL,
	COURSE_CODE VARCHAR(100) NOT NULL,
	NUMBER_OF_CREDITS SMALLINT NOT NULL,
	CORRESPONDING_YEAR SMALLINT NOT NULL,
	DEPARTMENT_ID VARCHAR(100) NOT NULL,
	FACULTY_ID VARCHAR(100) NOT NULL,
    MAX_NO_OF_STUDENTS INTEGER NOT NULL,
	PRIMARY KEY(COURSE_CODE,FACULTY_ID),
	FOREIGN KEY(DEPARTMENT_ID) REFERENCES DEPARTMENT(DEPARTMENT_ID),
	FOREIGN KEY(FACULTY_ID) REFERENCES FACULTY(FACULTY_ID)
);

CREATE TABLE STUDENT_LINK_LOGIN (
    SRN	VARCHAR(13) NOT NULL,
	EMAIL_ID VARCHAR(320) NOT NULL,
    completed TINYINT(1) DEFAULT false,
    TOKEN VARCHAR(64) DEFAULT NULL,
	PRIMARY KEY(SRN),
    UNIQUE(EMAIL_ID)

);

CREATE TABLE STUDENT (
	NAME_OF_THE_STUDENT VARCHAR(30)	NOT NULL,
	SRN	VARCHAR(13) NOT NULL,
	EMAIL_ID VARCHAR(320) NOT NULL,
	YEAR_OF_STUDY SMALLINT NOT NULL,
	SECTION VARCHAR(10) NOT NULL,
	DEPARTMENT_ID VARCHAR(100) NOT NULL,
	COURSE_CODE_1 VARCHAR(100) NOT NULL ,
	COURSE_CODE_2 VARCHAR(100) NOT NULL,
	FACULTY_ID_1 VARCHAR(100) NOT NULL,
	FACULTY_ID_2 VARCHAR(100) NOT NULL,
	PRIMARY KEY(SRN),
    FOREIGN KEY(EMAIL_ID) REFERENCES STUDENT_LINK_LOGIN(EMAIL_ID),
	FOREIGN KEY(SRN) REFERENCES STUDENT_LINK_LOGIN(SRN),
	FOREIGN KEY(DEPARTMENT_ID) REFERENCES DEPARTMENT(DEPARTMENT_ID),
	FOREIGN KEY(COURSE_CODE_1) REFERENCES ELECTIVE(COURSE_CODE),
	FOREIGN KEY(COURSE_CODE_2) REFERENCES ELECTIVE(COURSE_CODE),
	FOREIGN KEY(FACULTY_ID_1) REFERENCES FACULTY(FACULTY_ID),
	FOREIGN KEY(FACULTY_ID_2) REFERENCES FACULTY(FACULTY_ID),
    UNIQUE(EMAIL_ID)

    );

CREATE TABLE TEACHER_LOGIN (
	FACULTY_EMAIL VARCHAR(320) NOT NULL,
	FACULTY_PASSWORD VARCHAR(64) DEFAULT NULL,
    TOKEN VARCHAR(64) DEFAULT NULL,
	PRIMARY KEY(FACULTY_EMAIL),
	FOREIGN KEY(FACULTY_EMAIL) REFERENCES FACULTY(FACULTY_EMAIL)
);
CREATE TABLE ADMIN_LOGIN (
	ADMIN_EMAIL VARCHAR(320) NOT NULL,
	ADMIN_PASSWORD VARCHAR(64) DEFAULT NULL,
    TOKEN VARCHAR(64) DEFAULT NULL,
	PRIMARY KEY(ADMIN_EMAIL),
	FOREIGN KEY(ADMIN_EMAIL) REFERENCES FACULTY(FACULTY_EMAIL)
);

USE ELECTIVE;





